sql = """
select t.dt, sum(case when t.sim = 1 then 1 else 0 end)/ sum(1) as sim_ratio,
	sum(case when cast(t.order_sim as float) >=1.0 then 1 else 0 end)/ sum(1) as order_sim
from
(
select t1.dt,t1.order_id, t1.city_id, t2.sim,t2.reserver1 as order_sim, t2.coor_dist, t2.coordinates from
(select * from  map_bi.tmp_dwd_natl_sdk_navi_day where dt = {dt} and expr_group in ('1') and city_id in ('2', '10', '34', '85') and driver_app_version in ('5.1.38')) t1
left join
(select * from  didimap.gaode_sim_detail where year='2019' and month= '01' and day='{day}' and order_stage='4') t2
left join
(select get_json_object(param, '$.order_id') as order_id, get_json_object(param, '$.city_id') as city_id from  tmp.zgq_sim_trip where day = {dt}) t3
on (t1.order_id = t2.orderid and t1.city_id = t2.city_id and t1.order_id=t3.order_id and t1.city_id = t3.city_id)
where t2.orderid is not null and t2.city_id is not null and t3.order_id is not null and t3.city_id is not null
) t
group by t.dt;

"""

